(function($){

	var semrushFrame = {
		container : '#semrush-frame-container',

		init : function(){
			var container = $(semrushFrame.container);
			this.frame = $('<iframe src="http://semrush.com/" id="semrush-frame" ></iframe>').appendTo(container);
			this.frame.load(function(){
				$(".wpseo-sem-loader", container).remove();
				$("#semrush-frame", container).show();

				/*
				var css = $("<link/>", {
					rel: "stylesheet",
					type: "text/css",
					href: "/wp-content/plugins/wordpress-seo/css/wpseo-semrush.min.css"
				});
				var semDocument = $(document, this);
				semDocument.find('head').append(css);
				*/
			});
		}
	};

	$(document).ready(function(){
		semrushFrame.init();
	});

})(jQuery);